import {createRouter,createWebHashHistory} from 'vue-router'
import About from '../views/About/index'
import Home from '../views/home/index'

const router=createRouter({
    history:createWebHashHistory,
    routes:[
        {
            path:'/',
            name:'Home',
            component:Home
        },
        {
            path:'/about',
            name:'About',
            component:About
        }
    ]
})
export default router
